import image from "../assets/me.jpeg";
import "./Body.css";
import PageAboutMe from "./PageAboutMe";
import PageCharacterList from "./PageCharacterList";
import PageToDo from "./PageToDo";
import PageContact from "./PageContact";
import text from "./TextAboutMe.js";

const Body = (props) => {
  const name = "Name Surname";
  const aboutMe = text;

  return (
    <div>
      <PageAboutMe image={image} aboutMe={aboutMe} cv={cv} />
      <PageCharacterList />
      <PageToDo />
      <PageContact />
    </div>
  );
};

export default Body;
